import React from 'react';
import ReactDOM from 'react-dom';
import Student from './student';

// Student Component Rendered
const App = () => (
  <>
    <Student />
    <BookList />
  </>
);

// BookList Component
function BookList() {
  return (
    <section>
      <Book />
      <Book />
      <Author />
      <Author />
    </section>
  );
}

// Individual Book Component
const Book = () => {
  return (
    <article>
      <Image />
      <h2>Book Title</h2>
    </article>
  );
};

// Image Component
const Image = () => (
  <img
    src="https://images-na.ssl-images-amazon.com/images/I/51MB5SD5GIL._AC_UL200_SR200,200_.jpg"
    alt="Book Cover"
  />
);

